1	home	b29b5d2ce62e55412776ab98f05631e0aa96597b	Home		f	t			updated	1	<figure class="image"><img src="/1.svg"></figure>\n<h1 style="text-align:center;">UROLIME WIKI</h1>\n<p>&nbsp;</p>\n<h4>Urolime, a top DevOps consulting company develops bespoke solutions. Our technical experts design, develop and optimize systems and information to meet your infrastructure, application, and business needs. Mastering the latest cloud technologies and keeping pace with every new development Urolime focuses on what is important to your business.</h4>\n<p>&nbsp;</p>\n<h2 style="text-align:center;">Solutions We Deliver</h2>\n<p style="text-align:center;">In today's highly competitive world, Urolime as the leading Kubernetes consulting company and managed IT services provider delivers pragmatic and cost-effective solutions to our clients in other IT sectors too. We combine our strategy and analytics to seamlessly navigate through the unpredictable environment of technology. Businesses across industries are looking to IT service providers to reduce costs, increase productivity, and improve performance. As a global IT services provider with over a decade of experience in businesses across all industries around the world, Urolime can provide the enterprise IT solutions you need to increase efficiency, value and reduce costs.</p>\n<p>&nbsp;</p>\n<figure class="image"><img src="/2.png"></figure>\n	html	2023-09-08T09:23:39.817Z	ckeditor	en	1	2023-09-07T13:22:03.327Z	{}
2	home/how-to-use	8aaf305e8b5e7d3cef2c7d41a0dcd133b074e2ee	How-to-use		f	t			updated	2	<figure class="image"><img src="/urolimelogobig.png"></figure>\n<p>&nbsp;</p>\n<h3>Welcome to Urolime Wiki's How to use page</h3>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; Urolime wiki is a platform developed for adding the documentations of different kind of tasks done by the employees for developing their skills. It includes different sections like DevOps, Software and TechOps and all the platforms they used for their task completion.</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; You can ‘click’ on the different platforms provided under each departments in the left side of the screen to see the different projects done by different users on that platform.</p>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; If you want to check for a particular command or option or anything you can use the search bar to see where the values has been used according to your search and which document has that content.</p>\n<p>&nbsp;</p>\n<h4>Contribute to Urolime Wiki</h4>\n<p>&nbsp; &nbsp; &nbsp; &nbsp; If you want to add your tasks into this wiki, then request for an access to the webpage. Then &nbsp;you can use the given credentials to Login to the console. Then you con see that there is a page on the left side named Contributions. You can read the details about how to create and add your files to the page and what are the Do's and Don'ts .&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n	html	2023-09-08T09:30:49.490Z	ckeditor	en	1	2023-09-08T09:22:38.458Z	{}
